import React from "react";
import propTypes from 'prop-types';

function buttonList(props) {
    let buttons = ['Тайланд', 'Вьетнам', 'ОАЭ', 'Китай', 'Испания', 'Франция']
    return (
        buttons.map((button) => {
            return (<div>
                <button className={button}>{button}</button>
            </div>)})
    )
}
